                                <Route to="/wishlist" component={Mywishlist} com>Mywishlist</Route>
                            </NavItem>
                            <NavItem>
                                <Route to="/cart" component={Cart} ><img src={require('/Users/sussuman/Downloads/react-header-footer-template-master/src/images/cart.png')}/></Route>
                            </NavItem>
                            <NavItem>
                                <NavLink to="/User"><img src={require('/Users/sussuman/Downloads/react-header-footer-template-master/src/images/profile.png')}/></NavLink>
                            </NavItem>

                        </Nav>
                    </Collapse>
                </Navbar>


            </div>
        )
    }


export default Header;
